import React from 'react';
import s from "./Household.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories.js";
import Adverts from "../../Adverts/Adverts";

import archtect from './../architect.svg';
import auto from './../auto.svg';
import fridge from './../fridge.svg';
import furniture from './../furniture.svg';

import {
  MAIN_PAGE,
  TRANSPORT, IMMOVABLES, HOUSEHOLD,
  APPARTAMENTS, HOUSES,
  CARS, MOTO,
  APPLIANCE, FURNITURE, setLocationName
} from "../../redux/UrlReducer";

const Household = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={'Недвижимость'} imgPath={archtect} urlCategory={IMMOVABLES.url}/>
            <Category nameCategory={'Транспорт'} imgPath={auto} urlCategory={TRANSPORT.url}/>
            <Subcategories nameSubCat={'Бытовая техника'} imgPath={fridge} urlCategory={HOUSEHOLD.url} urlSubcategory={APPLIANCE.url}/>
            <Subcategories nameSubCat={'Мебель'} imgPath={furniture} urlCategory={HOUSEHOLD.url} urlSubcategory={FURNITURE.url}/>
          </div>
        </div>
      </div>
  );
};

export default Household;
